import {Link} from 'react-router-dom'; 
import {LuFileSymlink } from 'react-icons/lu';
import { IoBody } from "react-icons/io5";
import { AiOutlinePercentage } from "react-icons/ai";
import { TbMoodKidFilled } from "react-icons/tb";


import '../stylesheet/compsStyle/services.css';
export default function Services () {

    return (
        <>
            <div className='search-container'>
                <input type='text'placeholder='ابحث عن خدمة'/>
            </div><br/>
        <div className='services-div'>
            <Link><div className='box'>1</div></Link>
            <Link><div className='box'>2</div></Link>
            <Link><div className='box'>3</div></Link>
            <Link><div className='box'>4</div></Link>
        </div>
        </>
    )
};
